        <script>
  // Global storage for original styles
  const originalNodeColors = {};
  const originalNodeFonts = {};
  const originalEdgeColors = {};
  const originalEdgeWidths = {};

  function saveOriginalStyles() {
    const nodes = network.body.data.nodes.get();
    const edges = network.body.data.edges.get();

    nodes.forEach(node => {
      if (!originalNodeColors[node.id]) {
        originalNodeColors[node.id] = node.color;
        originalNodeFonts[node.id] = node.font || {color: "white"};
      }
    });

    edges.forEach(edge => {
      if (!originalEdgeColors[edge.id]) {
        // Save entire color object if it exists, else null
        originalEdgeColors[edge.id] = edge.color ? JSON.parse(JSON.stringify(edge.color)) : null;
        originalEdgeWidths[edge.id] = edge.width || 1;
      }
    });
  }

  network.once("afterDrawing", () => {
    saveOriginalStyles();
  });

  function toggleCommunity(groupId) {
    const nodes = network.body.data.nodes;
    const edges = network.body.data.edges;

    // Determine if group is active (not grayed)
    let isGroupActive = false;
    nodes.forEach((node) => {
      if (node.group === groupId && node.active !== false) {
        isGroupActive = true;
      }
    });

    // Toggle nodes colors and fonts
    const updatedNodes = [];
    nodes.forEach((node) => {
      if (node.group === groupId) {
        if (isGroupActive) {
          node.color = { background: "#888", border: "#444" };
          node.font = { color: "#666" };
          node.active = false;
        } else {
          node.color = originalNodeColors[node.id];
          node.font = originalNodeFonts[node.id];
          node.active = true;
        }
        updatedNodes.push(node);
      }
    });
    nodes.update(updatedNodes);

    // Toggle edges colors and widths
    const updatedEdges = [];
    edges.forEach((edge) => {
      const fromNode = nodes.get(edge.from);
      const toNode = nodes.get(edge.to);

      if (fromNode.active !== false && toNode.active !== false) {
        // Restore original color and width
        if (originalEdgeColors[edge.id]) {
          edge.color = JSON.parse(JSON.stringify(originalEdgeColors[edge.id]));
        } else {
          edge.color = null; // default
        }
        edge.width = originalEdgeWidths[edge.id];
      } else {
        edge.color = "#555";
        edge.width = 0.5;
      }
      updatedEdges.push(edge);
    });
    edges.update(updatedEdges);
  }
</script>
        
        <div style="position:absolute;top:10px;right:10px;z-index:999;background:#fff;padding:8px;border-radius:5px;">
          <input type="text" id="nodeSearchInput" placeholder="Search node..." style="width:150px; padding:4px;" />
          <button onclick="searchNode()">Go</button>
        </div>

        <script>
          function searchNode() {
            const input = document.getElementById('nodeSearchInput').value.trim();
            if (!input) return;

            const nodes = network.body.data.nodes.get();
            const node = nodes.find(n => n.id.toString() === input || n.label === input);
            if (node) {
              // Select the node
              network.selectNodes([node.id]);
              // Focus on the node
              network.focus(node.id, {scale: 1.5, animation: true});
            } else {
              alert('Node not found: ' + input);
            }
          }

          // Optional: Enter key triggers search
          document.getElementById('nodeSearchInput').addEventListener('keypress', function(e) {
            if (e.key === 'Enter') {
              searchNode();
            }
          });
        </script>
